import * as React from 'react';
import { StyleSheet, Text, View, Button, SafeAreaView , ScrollView, Image} from 'react-native';


export default function Dashboard({navigation}) {
    const officeWork = () => {
      navigation.navigate('OfficeWork');
    }

    return (
        <SafeAreaView style={styles.container}>
                <ScrollView>
            <Text style={styles.Heading}> Categories </Text>
          
                <View style={styles.homeButton1}>
                    <Button title="officeWork" color="blue" onPress={officeWork} />
                    <Image style={styles.img}
                    source={{
                        uri:'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQRaM-7GTBOHbhRYiTerbP0NzWeJaYDNuTpCg&usqp=CAU',
                        width:'100%',
                        height:200,
                    }}
                    />
                    <Button title="personalWork" color="blue" />
                    <Image style={styles.img}
                    source={{
                        uri:'https://www.investopedia.com/thmb/bHpR3LkvI5BpmLoOO1oeYB0bsow=/1500x1000/filters:fill(auto,1)/personal-finance-work-from-home-guide_round1_grey-dfcbdfa007674b3bb6a568c8cf42b849.png',
                        width:'100%',
                        height:200,
                    }}
                    />
                    <Button title="familyWork" color="blue" />
                    <Image style={styles.img}
                    source={{
                        uri:'https://susandayley.files.wordpress.com/2012/02/mormon-gardening.jpg',
                        width:'100%',
                        height:200,
                    }}
                    />
                </View>
                </ScrollView>
           

        </SafeAreaView>
    )
};

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#fff',
    },
    Heading: {
        fontSize: 50,
        fontWeight: 'bold',
        color: 'blue',
        textAlign: 'center',
        paddingTop: 5,
    },
    img:{
        marginBottom:20,
    },
    homeButton1: {
        padding: 30,
        width: '100%',
        height: '30%',
    },
   
});
